import { MdSearch } from 'react-icons/md'
export default function Search({ handleSearch }) {
    return(
        <div className="search">
            <input 
            type="text"
            placeholder='Search...' />
            <MdSearch className='search--icons' size='1.3em' 
            onClick={(event) => handleSearch(event.target.value)}
            />
        </div>
    )
};
